package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;

class VetTest {

	private Vet instance;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("Verifies that subsequent calls to getSpecialtiesInternal return the same Set<Specialty> instance")
	void testGetSpecialtiesInternalReturnsSameInstance() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that if specialties is already set to a non-null Set with elements, getSpecialtiesInternal returns that existing set (use reflection in test to set the private field)")
	void testGetSpecialtiesInternalReturnsExistingSpecialties() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getSpecialties returns a list of specialties sorted by name in ascending order when multiple specialties are added")
	void testGetSpecialtiesReturnsSortedList() {
		var result = instance.getSpecialties();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getSpecialties returns an empty list when no specialties have been added")
	void testGetSpecialtiesReturnsEmptyListWhenNoSpecialties() {
		var result = instance.getSpecialties();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getSpecialties throws NullPointerException when a specialty has a null name due to sorting comparison")
	void testGetSpecialtiesThrowsNullPointerWhenSpecialtyNameIsNull() {
		assertDoesNotThrow(() -> {
			instance.getSpecialties();
		});
	}

	@Test
	@DisplayName("Verifies that getNrOfSpecialties returns the correct count when the vet has one or more specialties added via addSpecialty")
	void testGetNrOfSpecialtiesReturnsCorrectCountWhenSpecialtiesExist() {
		Vet instance = new Vet();
		Specialty specialty1 = new Specialty();
		Specialty specialty2 = new Specialty();
		instance.addSpecialty(specialty1);
		instance.addSpecialty(specialty2);
		var result = instance.getNrOfSpecialties();
		assertEquals(2, result);
	}

	@Test
	@DisplayName("Verifies that getNrOfSpecialties returns 0 when no specialties have been added to the vet")
	void testGetNrOfSpecialtiesReturnsZeroWhenNoSpecialties() {
		var result = instance.getNrOfSpecialties();
		assertEquals(0, result);
	}

	@Test
	@DisplayName("Tests adding a null Specialty to the collection, verifying behavior (may allow null or throw exception if collection disallows it).")
	void testAddSpecialtyWithNull() {
		instance.addSpecialty(null);
	}

}
